import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './InspectorDashboard.css';

const InspectorDashboard: React.FC = () => {
    const navigate = useNavigate();
    const [user, setUser] = useState<any>(null);

    useEffect(() => {
        // Check if user is logged in and is an inspector
        const userData = localStorage.getItem('currentUser');
        if (!userData || JSON.parse(userData).role !== 'inspector') {
            navigate('/login');
            return;
        }
        setUser(JSON.parse(userData));
    }, [navigate]);

    if (!user) {
        return <div>Loading...</div>;
    }

    return (
        <div className="inspector-dashboard">
            <header className="dashboard-header">
                <h1>Inspector Dashboard</h1>
                <div className="user-profile">
                    <span>Welcome, Inspector {user.username}</span>
                </div>
            </header>
            {/* Inspector-specific content */}
        </div>
    );
};
